import React from "react";
import Card from "react-bootstrap/Card";

const Result = (data) => {
    if (data[0]) {
        return (

            <div>
                <>
                    <Card style={{ width: "22rem" }}>
                        <Card.Body>
                            <Card.Title style={{ color: "green" }}>{data[0].place_name}</Card.Title>
                            <Card.Text>{data[0].summary}</Card.Text>
                        </Card.Body>
                    </Card>
                </>
            </div>

        );
    } else {
        return (
            <div />
        );
    }
};

export default Result;
